description:
Wednesday September 17, 2008.

Today, is Open Line Wednesday. Alex tackles the top news stories of the day and takes your calls. Today is a sad day... Barry Jennings, the WTC7 eyewitness to explosions and death prior to it&amp;#039;s collapse, is dead today at 53! Jason Bermas and Aaron Dykes join Alex to discuss this troubling development.
